import React from 'react';
import AuthService from "../services/auth.service";
import { useNavigate, Link } from "react-router-dom";

const Homer = () => {
    const user = AuthService.getCurrentUser();
    const logOut = () => {
      AuthService.logout();
      window.location.reload();
    };
  
    return (
      <header>
        <nav>
          <ul>
            {user ? (
              <>
                <p>Hi, {user.user.name}</p>
              </>
            ) : (
              <>
                <p></p>
              </>
            )}
          </ul>
        </nav>
      </header>
    );
  };
  
  export default Home;
